import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Switch, Route} from 'react-router-dom'
import AddBook1 from './component/Book/AddBook1';
import Books from './component/Book/Books.js';
import Navbar from './component/Navbar/Navbar';
import RegisterUser from './component/users/RegisterUser';
import LoginUser from './component/users/LoginUser';

function App() {
  return (
    <> 
    <BrowserRouter>
         <Navbar/>
      <Switch>
         <Route exact path ='/books' component = {Books}/ >
         <Route exact path ='/addbook' component = {AddBook1}/>
         <Route exact path ='/register' component = {RegisterUser}/>
         <Route exact path ='/login' component = {LoginUser}/>
       </Switch>
    </BrowserRouter>
    {/* <Books/> */}
    </>
  );
}

export default App
